(13, 'about_us', 'About Us', 'আমাদের সম্পর্কে', '<blockquote>\r\n<ol>\r\n	<li>\r\n	<h1><strong>Border <em>Guard Public School </em></strong><em>&amp;</em> College is situated in a solution environment the Head Quarters of BGB at Akhalia in the Holy land Sylhet. This Institution started its journey with a view to developing the educational development of this region lender the little of Reflex Public School in 1993 with the patronage and management of the then BDR, Sylhet. With the circumlocution of time, it has been named as Border Guard Public School. In 2012 it has been upgraded as college on approval of Ministry of Education and Sylhet Education Board. Enlarged campus well decorated class rooms. shipshape environment, efficient and experienced teachers are always devoted to ensure quality education.</h1>\r\n	</li>\r\n	<li>\r\n	<h1>&nbsp;</h1>\r\n	</li>\r\n	<li>\r\n	<h1>We teach student using advanced learning materials and ensure a congenial learning materials and ensure a congenial environment for connective Practice, regular test, systematic and most importantly science based activities in the classrooms targeting Academic calendar published for each year under the guidance of Minstry of Education, Sylhet Education Board X BGB Sylhet Sector to meet the challenges of 21st century, to bring out proper tatent X tocreat good citizens confidentially and morally and morally. Politics &amp; main features of this institution. Besides these, there are a magnificent mosque, Shahid Minar, The symbol of national spiritm library, sophisticated computer lab, Science Laboratories, canteen and a big play ground. As a result this institution has been establishing its superiority both in curricular and co-curricular activities. Special Programs and different competitive programs are arranged on Annual sports, Annual Milad Mahfil, cultural and competition bad program, celebration of Bangla new year and national Days. Besides, reception for talented student and respectful felicitation to teachers in school in special fields are offered every year.</h1>\r\n	</li>\r\n	<li>\r\n	<h1>&nbsp;</h1>\r\n	</li>\r\n	<li>\r\n	<h1>This institution has been able to acquire appraisal in the field of inter school &amp; college debate, cultural competition, essay competition and education co-curricular activities.</h1>\r\n	</li>\r\n	<li>\r\n	<h1>With the combining effects of students, teachers, guidance and most importantly for the skilled management of the Governing Body, the passing rate of the institution in the last Public examinations is 100% and&nbsp; as a result the institution has already placed itself in the Top-20 of Sylhet Education Board.</h1>\r\n	</li>\r\n	<li>\r\n	<h1>&nbsp;</h1>\r\n	</li>\r\n	<li>\r\n	<h1>We are determined to shape it as the best educational institution of Sylhet as well as&nbsp; Bangladesh Maintaining consistency in the acquired&nbsp; result and reputation. Our only expectation is to get the cordial co-operation of all to administer the institution and improve the standard of education.</h1>\r\n	</li>\r\n	<li>\r\n	<h1 style=\"font-style: italic;\">&nbsp;</h1>\r\n	</li>\r\n	<li>\r\n	<h1>May Allah help us all. Thanks to all.&nbsp;&nbsp;&nbsp;</h1>\r\n	</li>\r\n</ol>\r\n</blockquote>\r\n', '<p><strong>একবিংশ শতাব্দীর চ্যালেঞ্জ মোকাবেলা ও মেধার সঠিক বিকাশ সাধন এবং নৈতিকতার আত্মবিশ্বাসী সুনাগরিক</strong> হিসেবে গড়ে তোলার লক্ষে বিজ্ঞানভিত্তিক শ্রেণি কার্যক্রম, পপদ্ধতিগত শিক্ষা, নিয়মিত পরীক্ষা, ধারাবাহিক অনুশীলন, আধুনিক শিক্ষা উপকরণ ব্যবহার পূর্বক পাঠদান করা হয়্ রাজনীতি ও ধূমপান মুক্ত, নিরাপদ ও সুশৃঙ্খল শিক্ষা পরিবেশ।&nbsp;একবিংশ শতাব্দীর চ্যালেঞ্জ মোকাবেলা ও মেধার সঠিক বিকাশ সাধন এবং নৈতিকতার আত্মবিশ্বাসী সুনাগরিক হিসেবে গড়ে তোলার লক্ষে বিজ্ঞানভিত্তিক শ্রেণি কার্যক্রম, পপদ্ধতিগত শিক্ষা, নিয়মিত পরীক্ষা, ধারাবাহিক অনুশীলন, আধুনিক শিক্ষা উপকরণ ব্যবহার পূর্বক পাঠদান করা হয়্ রাজনীতি ও ধূমপান মুক্ত, নিরাপদ ও সুশৃঙ্খল শিক্ষা পরিবেশ।&nbsp;</p>\r\n\r\n<p>একবিংশ শতাব্দীর চ্যালেঞ্জ মোকাবেলা ও মেধার সঠিক বিকাশ সাধন এবং নৈতিকতার আত্মবিশ্বাসী সুনাগরিক হিসেবে গড়ে তোলার লক্ষে বিজ্ঞানভিত্তিক শ্রেণি কার্যক্রম, পপদ্ধতিগত শিক্ষা, নিয়মিত পরীক্ষা, ধারাবাহিক অনুশীলন, আধুনিক শিক্ষা উপকরণ ব্যবহার পূর্বক পাঠদান করা হয়্ রাজনীতি ও ধূমপান মুক্ত, নিরাপদ ও সুশৃঙ্খল শিক্ষা পরিবেশ।&nbsp;<br />\r\n<br />\r\n<br />\r\n<br />\r\n&nbsp;</p>\r\n', 'Aug 04, 2019', '2020-03-09', '.jpeg', 0),
(53, 'chairman-speech', 'Chairman Speech', 'সভাপতির বাণী', '<div>I feel pleasure to know that our school is going to open its own website to flow of information. Through this newly opened website. The over all activities of the institution will be ensured getting new speed and accountability. I hope the website activities will be rich in information and &nbsp;be updated regularly.</div><div><br></div><div>Those who are related opening the website is thanked and felicitated wholeheartedly.</div><div>The student of this institution will be enlighten citizens by attaining quality education and their on way will be furnished one &nbsp;blessed with truths and morality. My heartiest &nbsp;good wish is all .</div><div><br></div><div>I wish graduated &nbsp;progress &nbsp;of this renowned Institution.</div>', '<div>শতবর্ষের ঐতিহ্যবাহী বিদ্যালয় সরকারী অগ্রগামি বালিকা উচ্চ বিদ্যালয় ও কলেজ সিলেট বিভাগ তথা সারাদেশে নারী শিক্ষার অগ্রগতিতে অনন্য ভূমিকা রাখছে। শিক্ষার পাশাপাশি অত্র প্রতিষ্ঠানের শিক্ষার্থীরা সাহিত্য, সংস্কৃতি, খেলাধুলা, প্রযুক্তি, বিতর্ক, বিজ্ঞান সকল ক্ষেত্রে কৃতিত্ব অর্জন করে বিদ্যালয়ের সুনাম অক্ষুন্ন রেখে চলেছে।</div><div><br></div><div><br></div><div>অত্র বিদ্যালয় থেকে একজন শিক্ষার্থী মেধাবী, সৎ, কমর্ঠ, আধুনিক বিজ্ঞান মনষ্ক, যোগ্য দেশপ্রেমিক ও মানবিক মূল্যবোধ সম্পন্ন আলোকিত মানুষ হয়ে বাংলাদেশকে সমৃদ্ধের পথে এগিয়ে নিয়ে যাবে এ আমার দৃঢ় প্রত্যাশা। শতবর্ষের ঐতিহ্যবাহী বিদ্যালয় সরকারী অগ্রগামি বালিকা উচ্চ বিদ্যালয় ও কলেজ সিলেট বিভাগ তথা সারাদেশে নারী শিক্ষার অগ্রগতিতে অনন্য ভূমিকা রাখছে। শিক্ষার পাশাপাশি অত্র প্রতিষ্ঠানের শিক্ষার্থীরা সাহিত্য, সংস্কৃতি, খেলাধুলা, প্রযুক্তি, বিতর্ক, বিজ্ঞান সকল ক্ষেত্রে কৃতিত্ব অর্জন করে বিদ্যালয়ের সুনাম অক্ষুন্ন রেখে চলেছে।</div><div><br></div><div><br></div><div>অত্র বিদ্যালয় থেকে একজন শিক্ষার্থী মেধাবী, সৎ, কমর্ঠ, আধুনিক বিজ্ঞান মনষ্ক, যোগ্য দেশপ্রেমিক ও মানবিক মূল্যবোধ সম্পন্ন আলোকিত মানুষ হয়ে বাংলাদেশকে সমৃদ্ধের পথে এগিয়ে নিয়ে যাবে এ আমার দৃঢ় প্রত্যাশা।</div><div><br></div>', 'November 19, 2016', '2020-03-09', '.jpeg', 0),
(54, 'principal-speech', 'Head Master Speech', 'প্রধান শিক্ষকের বাণী', '<div>I feel pleasure to know that our school is going to open its own website to flow of information. Through this newly opened website. The over all activities of the institution will be ensured getting new speed and accountability. I hope the website activities will be rich in information and &nbsp;be updated regularly.</div><div><br></div><div>Those who are related opening the website is thanked and felicitated wholeheartedly.</div><div>The student of this institution will be enlighten citizens by attaining quality education and their on way will be furnished one &nbsp;blessed with truths and morality. My heartiest &nbsp;good wish is all .</div><div><br></div><div>I wish graduated &nbsp;progress &nbsp;of this renowned Institution. I feel pleasure to know that our school is going to open its own website to flow of information. Through this newly opened website. The over all activities of the institution will be ensured getting new speed and accountability. I hope the website activities will be rich in information and &nbsp;be updated regularly.</div><div><br></div><div>Those who are related opening the website is thanked and felicitated wholeheartedly.</div><div>The student of this institution will be enlighten citizens by attaining quality education and their on way will be furnished one &nbsp;blessed with truths and morality. My heartiest &nbsp;good wish is all .</div><div><br></div><div>I wish graduated &nbsp;progress &nbsp;of this renowned Institution.&nbsp;</div><div><br></div><div><br></div>', '<div>শতবর্ষের ঐতিহ্যবাহী বিদ্যালয় সরকারী অগ্রগামি বালিকা উচ্চ বিদ্যালয় ও কলেজ সিলেট বিভাগ তথা সারাদেশে নারী শিক্ষার অগ্রগতিতে অনন্য ভূমিকা রাখছে। শিক্ষার পাশাপাশি অত্র প্রতিষ্ঠানের শিক্ষার্থীরা সাহিত্য, সংস্কৃতি, খেলাধুলা, প্রযুক্তি, বিতর্ক, বিজ্ঞান সকল ক্ষেত্রে কৃতিত্ব অর্জন করে বিদ্যালয়ের সুনাম অক্ষুন্ন রেখে চলেছে। অত্র বিদ্যালয় থেকে একজন শিক্ষার্থী মেধাবী, সৎ, কমর্ঠ, আধুনিক বিজ্ঞান মনষ্ক, যোগ্য দেশপ্রেমিক ও মানবিক মূল্যবোধ সম্পন্ন আলোকিত মানুষ হয়ে বাংলাদেশকে সমৃদ্ধের পথে এগিয়ে নিয়ে যাবে এ আমার দৃঢ় প্রত্যাশা। শতবর্ষের ঐতিহ্যবাহী বিদ্যালয় সরকারী অগ্রগামি বালিকা উচ্চ বিদ্যালয় ও কলেজ সিলেট বিভাগ তথা সারাদেশে নারী শিক্ষার অগ্রগতিতে অনন্য ভূমিকা রাখছে। শিক্ষার পাশাপাশি অত্র প্রতিষ্ঠানের শিক্ষার্থীরা সাহিত্য, সংস্কৃতি, খেলাধুলা, প্রযুক্তি, বিতর্ক, বিজ্ঞান সকল ক্ষেত্রে কৃতিত্ব অর্জন করে বিদ্যালয়ের সুনাম অক্ষুন্ন রেখে চলেছে। অত্র বিদ্যালয় থেকে একজন শিক্ষার্থী মেধাবী, সৎ, কমর্ঠ, আধুনিক বিজ্ঞান মনষ্ক, যোগ্য দেশপ্রেমিক ও মানবিক মূল্যবোধ সম্পন্ন আলোকিত মানুষ হয়ে বাংলাদেশকে সমৃদ্ধের পথে এগিয়ে নিয়ে যাবে এ আমার দৃঢ় প্রত্যাশা।&nbsp;</div><div><br></div><div><br></div><div><br></div>', 'September 08, 2015', '2020-03-09', '.jpeg', 0),
