(9, ' Tomorrow  college public holiday', 'আগামী কাল কলেজ সরকারি ছুটি', 'In a civil case, personal jurisdiction over a defendant is obtained by service of a summons. Service can be accomplished by personal delivery of the summons or subpoena to the person or an authorized agent of the person. Service may also be made by substituted means; for example, in many jurisdictions, service of a summons can be made on a person of suitable age and discretion at the residence or place of business of the defendant. Jurisdiction over corporations can often be obtained through a government body authorized to receive such process.\r\n\r\n', 'কোনও দেওয়ানী মামলায়, বিবাদীর বিরুদ্ধে ব্যক্তিগত এখতিয়ার একটি সমন পরিষেবা দ্বারা প্রাপ্ত হয়। পরিষেবা বা ব্যক্তি বা ব্যক্তির অনুমোদিত এজেন্টের কাছে সমন বা উপপুনের ব্যক্তিগত বিতরণ দ্বারা সম্পাদন করা যেতে পারে। বিকল্প বিকল্প উপায়ে পরিষেবাও তৈরি করা যেতে পারে; উদাহরণস্বরূপ, অনেক আইনশাস্ত্রে, উপযুক্ত বয়সী ও বিচক্ষণ ব্যক্তির পক্ষে বিবাদীর বাসভবন বা ব্যবসায়ের জায়গায় সমন পরিষেবা দেওয়া যেতে পারে। কর্পোরেশনগুলির এখতিয়ার প্রায়শই এই জাতীয় প্রক্রিয়া পাওয়ার জন্য অনুমোদিত সরকারী সংস্থার মাধ্যমে প্রাপ্ত হতে পারে।', 'attachment.xlsx', '03/04/2020', '03/10/2020-11:00 AM', '2020-03-10', '2020-03-10', 'md jamil aj', 0),
(10, ' Tomorrow  college public holiday', 'আগামী কাল কলেজ সরকারি ছুটি', 'In a civil case, personal jurisdiction over a defendant is obtained by service of a summons. Service can be accomplished by personal delivery of the summons or subpoena to the person or an authorized agent of the person. Service may also be made by substituted means; for example, in many jurisdictions, service of a summons can be made on a person of suitable age and discretion at the residence or place of business of the defendant. Jurisdiction over corporations can often be obtained through a government body authorized to receive such process.\r\n\r\n', 'কোনও দেওয়ানী মামলায়, বিবাদীর বিরুদ্ধে ব্যক্তিগত এখতিয়ার একটি সমন পরিষেবা দ্বারা প্রাপ্ত হয়। পরিষেবা বা ব্যক্তি বা ব্যক্তির অনুমোদিত এজেন্টের কাছে সমন বা উপপুনের ব্যক্তিগত বিতরণ দ্বারা সম্পাদন করা যেতে পারে। বিকল্প বিকল্প উপায়ে পরিষেবাও তৈরি করা যেতে পারে; উদাহরণস্বরূপ, অনেক আইনশাস্ত্রে, উপযুক্ত বয়সী ও বিচক্ষণ ব্যক্তির পক্ষে বিবাদীর বাসভবন বা ব্যবসায়ের জায়গায় সমন পরিষেবা দেওয়া যেতে পারে। কর্পোরেশনগুলির এখতিয়ার প্রায়শই এই জাতীয় প্রক্রিয়া পাওয়ার জন্য অনুমোদিত সরকারী সংস্থার মাধ্যমে প্রাপ্ত হতে পারে।', 'attachment.xlsx', '03/17/2020', '03/10/2020-2:00 PM', '2020-03-10', '2020-03-10', 'md jamil aj', 0),
