(19, ' Tomorrow  college public holiday', 'আগামী কাল কলেজ সরকারি ছুটি', '<blockquote>\r\n<p><strong>&nbsp;If you only want the code to run w</strong>hen the &quot;Save changes&quot; button is clicked, then you&#39;ll want to attach the handler to the click event of that button instead:&nbsp;If you only want the code to run when the &quot;Save changes&quot; button is clicked, then you&#39;ll want to attach the <em>handler to the click event of that button instead:</em></p>\r\n</blockquote>\r\n', '<p>&nbsp;</p>\r\n\r\n<blockquote>\r\n<p><strong>যদি আপনি কেবল &quot;পরিবর্তনগুলি সংরক্ষণ করুন&quot; </strong>বোতামটি ক্লিক করার সময় কোডটি চালানো চান, তবে আপনি পরিবর্তে সেই বোতামটির ক্লিক ইভেন্টের সাথে হ্যান্ডলারটি সংযুক্ত করতে চাইবেন:যদি আপনি কেবল &quot;পরিবর্তনগুলি সংরক্ষণ করুন&quot; বোতামটি ক্লিক করার সময় কোডটি চালানো চান, তবে আপনি পরিবর্তে সেই বোতামটির ক্লিক<em> ইভেন্টের সাথে হ্যান্ডলারটি সংযুক্ত করতে চাইবেন:</em></p>\r\n</blockquote>\r\n\r\n<p>&nbsp;</p>\r\n', 'attachment.xlsx', '03/12/2020', '03/25/2020-10:00 AM', '2020-03-12', '2020-03-12', 'md jamil aj', 1),
